import React from 'react';
import PropTypes from 'prop-types';
import { CSSTransitionGroup } from 'react-transition-group';
import Question from '../QuizQuestion/Question';
import QuestionCount from '../QuizQuestion/QuestionCount';
import { Button } from 'react-bootstrap';


function ButtonQuiz(props) {

  return (
    <CSSTransitionGroup
      className="container"
      component="div"
      transitionName="fade"
      transitionEnterTimeout={800}
      transitionLeaveTimeout={500}
      transitionAppear
      transitionAppearTimeout={500}
    >
      <div key={props.questionCount}>
        <QuestionCount counter={props.questionCount} total={props.questionTotal} />
        <Question content={props.question} />
      </div>
      <center>
        <Button className="buttonInstructionStart" onClick={()=>props.onAnswerSelected('nan',props.questionId,event)}>Continue</Button>
      </center>
    </CSSTransitionGroup>
  );
}

ButtonQuiz.propTypes = {
  answer: PropTypes.string.isRequired,
  question: PropTypes.string.isRequired,
  questionId: PropTypes.number.isRequired,
  questionCount: PropTypes.number.isRequired,
  questionTotal: PropTypes.number.isRequired,
  onAnswerSelected: PropTypes.func.isRequired
};

export default ButtonQuiz;
